import React from "react";
import { Route, BrowserRouter } from "react-router-dom";

import informacao from "./paginas/informacao";


const Routes = () => {
  return (
    <BrowserRouter>
      <Route component={informacao} path="/" exact />
    </BrowserRouter>
  );
};

export default Routes;
